create table environment
(
    environmentid         serial                not null
        constraint environment_pkey
            primary key,
    projectid             smallint              not null
        constraint environment_projectid_fkey
            references project,
    siteid                integer               not null
        constraint environment_siteid_fkey
            references site,
    envobservedate        date                  not null,
    envobserverid         smallint              not null
        constraint environment_envobserverid_fkey
            references personnel,
    soilobserverid        smallint
        constraint environment_soilobserverid_fkey
            references personnel,
    strataid              smallint
        constraint environment_strataid_fkey
            references stratification,
    physiographyid        smallint
        constraint environment_physiographyid_fkey
            references physiography,
    geomorphologyid       smallint
        constraint environment_geomorphologyid_fkey
            references geomorphology,
    macrotopographyid     smallint
        constraint environment_macrotopographyid_fkey
            references macrotopography,
    microtopographyid     smallint
        constraint environment_microtopographyid_fkey
            references microtopography,
    microrelief           numeric(4, 1),
    drainageid            smallint
        constraint environment_drainageid_fkey
            references drainage,
    moistureid            smallint
        constraint environment_moistureid_fkey
            references moisture,
    soilclassid           smallint
        constraint environment_soilclassid_fkey
            references soilclass,
    depthwater            numeric(4, 1),
    depthmossduff         numeric(4, 1),
    depthrestrictivelayer numeric(4, 1),
    restrictivetypeid     smallint
        constraint environment_restrictivetypeid_fkey
            references restrictivetype,
    soilph10              numeric(4, 2),
    conductivity10        numeric(7, 2),
    temperature10         numeric(5, 2),
    soilph30              numeric(4, 2),
    conductivity30        numeric(7, 2),
    temperature30         numeric(5, 2),
    waterph               numeric(4, 2),
    waterconductivity     numeric(7, 2),
    watertemperature      numeric(5, 2),
    disturbanceid         smallint
        constraint environment_disturbanceid_fkey
            references disturbance,
    homogenous            boolean default false not null
);

alter table environment
    owner to postgres;

